import * as React from 'react';
import ProfileCard from "./ProfileCard";
import style from './mystyle.module.css';
import {Container, Row, Col} from 'react-bootstrap';
import WebDeveloper from './images/web-developer.png';
import DataAnalysis from './images/data-analysis.png';
import Librarian from './images/librarian.png';
import Header from './Header';
import 'mdb-react-ui-kit/dist/css/mdb.min.css';
import "@fortawesome/fontawesome-free/css/all.min.css";

function App(){
  return (
    <div>
      <Header />
      <Container style={{marginTop: '20px'}}>
        <Row >
          <Col md={2} style={{border: '3px solid gray'}}>SideBar</Col>
          <Col md={10}>
            <Container>
              <Row className="show-grid" style={{border: '3px solid gray' , padding: '20px', marginBottom: '10px'}}>
                <Col xs={12} md={12} lg={12}>Perofessional Experiences</Col>
              </Row>
              <Row className="show-grid" style={{border: '3px solid gray',padding: '25px'}}>
                <Col xs={3} md={4} lg={4}>
                  <ProfileCard professionalExperience="Web Developer" image={WebDeveloper} />
                </Col>
                <Col xs={3} md={4} lg={4}>
                  <ProfileCard professionalExperience="Data Analysis" image={DataAnalysis} />
                </Col>
                <Col xs={3} md={4} lg={4}>
                  <ProfileCard professionalExperience="Librarian" image={Librarian} />
                </Col>
              </Row>
            </Container>
          </Col>
        </Row>
      </Container>
    </div>

  );
}

export default App;
